import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class UserList extends Component {
    constructor(props) {
        super(props);

        this.state = {
            users: []
        }

        this.searchQuery = this.searchQuery.bind(this);
    }


    searchQuery(e) {
        this.setState({
            query: e.target.value
        })
    }

    render() {
        return (
            <div>

            </div>
        )
    }
}
